import React, { Component } from "react"
import IndexSlider from "./ImageSilder"
import IndexMenu from "./Indexmenu"
import "./index.scss"
import { foodmenu } from "../utlis/data"

const Index = () => {
  let num = 1
  const indexChnager = () => {
    return num++
  }
  const changeNum = () => {
    setInterval(indexChnager, 1000)
  }
  return (
    <div className="index">
      {console.log(setInterval(indexChnager, 1000))}
      <div className="index-slider">
        {/* foodmenu.map(item => (
          <IndexSlider link={item.img} alt={item.alt} />
        )) */}
        <div className="slider-hero">
          <IndexSlider link={foodmenu[(changeNum())].img} />
        </div>
      </div>
      <div className="index-menu">
        <IndexMenu />
      </div>
    </div>
  )
}

export default Index
